(3, 'Акция имени Дмитрия Маршала(ПЕПЕЛЬНОГО)', '21-ого марта  стоимость пиццы для игроков в PUBG:Mobile повышается на 2000%.', '21-ого марта  стоимость пиццы для игроков в PUBG:Mobile повышается на 2000%.<br>\r\nПри заходе в кафе в этот день, обязательно предъявите свой мобильный телефон, желательно POCO X3 NFC.'),
